import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

let myPostsData = [
  {id:1, title: "Пост 1", text: "Текст", likes: 12, dislikes: 3},
  {id:1, title: "Пост 2", text: "Текст", likes: 16, dislikes: 5},
  {id:1, title: "Пост 3", text: "Текст", likes: 21, dislikes: 8},
  {id:1, title: "Пост 4", text: "Текст", likes: 16, dislikes: 2},
]

ReactDOM.render(
  <App myPostsData={myPostsData}/>, document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
